import React, { useEffect, useState } from 'react';
import { getAccountDetails, getTransactionHistory } from '../utils/api';
import { formatCurrency } from '../utils/helpers';

function AccountDetails({ accountId }) {
  const [account, setAccount] = useState(null);
  const [transactions, setTransactions] = useState([]);
  const [loadingAccount, setLoadingAccount] = useState(true);
  const [loadingTx, setLoadingTx] = useState(true);
  const [errorAccount, setErrorAccount] = useState(null);
  const [errorTx, setErrorTx] = useState(null);

  useEffect(() => {
    if (!accountId) return;

    setLoadingAccount(true);
    getAccountDetails(accountId)
      .then(response => {
        setAccount(response.data);
        setLoadingAccount(false);
      })
      .catch(() => {
        setErrorAccount('Failed to load account details.');
        setLoadingAccount(false);
      });

    setLoadingTx(true);
    getTransactionHistory(accountId)
      .then(response => {
        setTransactions(response.data);
        setLoadingTx(false);
      })
      .catch(() => {
        setErrorTx('Failed to load transaction history.');
        setLoadingTx(false);
      });
  }, [accountId]);

  if (!accountId) return <p>Please select an account to view details.</p>;
  if (loadingAccount) return <p>Loading account details...</p>;
  if (errorAccount) return <p>{errorAccount}</p>;

  return (
    <div>
      <h2>Account Details</h2>
      <p><strong>Account Number:</strong> {account.accountNumber}</p>
      <p><strong>Account Holder:</strong> {account.accountHolderName}</p>
      <p><strong>Account Type:</strong> {account.accountType}</p>
      <p><strong>Balance:</strong> {formatCurrency(account.balance)}</p>
      <p><strong>Created Date:</strong> {new Date(account.createdDate).toLocaleDateString()}</p>

      <h3>Transaction History</h3>
      {loadingTx && <p>Loading transactions...</p>}
      {errorTx && <p>{errorTx}</p>}
      {!loadingTx && !errorTx && transactions.length === 0 && <p>No transactions found.</p>}

      {!loadingTx && !errorTx && transactions.length > 0 && (
        <table>
          <thead>
            <tr>
              <th>Date</th>
              <th>Type</th>
              <th>Amount</th>
              <th>Description</th>
              <th>Recipient Account</th>
            </tr>
          </thead>
          <tbody>
            {transactions.map(tx => (
              <tr key={tx.id}>
                <td>{new Date(tx.date).toLocaleString()}</td>
                <td>{tx.type}</td>
                <td>{formatCurrency(tx.amount)}</td>
                <td>{tx.description || '-'}</td>
                <td>{tx.recipientAccount || '-'}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default AccountDetails;
